import React from "react";
import "./style.css";

import rectangle1 from "../../LandingPageImg/landing-page-rectangle-1@2x.png";
import rectangle2 from "../../LandingPageImg/landing-page-rectangle-copy-2@2x.png";
import rectangle3 from "../../LandingPageImg/landing-page-rectangle-copy-3@2x.png";
import rectangle7 from "../../LandingPageImg/landing-page-rectangle-copy-7@2x.png";
import rectangle8 from "../../LandingPageImg/landing-page-rectangle-copy-8@2x.png";
import rectangle9 from "../../LandingPageImg/landing-page-rectangle-copy-9@2x.png";
import rectangle13 from "../../LandingPageImg/landing-page-rectangle-copy-13@2x.png";
import rectangle14 from "../../LandingPageImg/landing-page-rectangle-copy@2x.png";



const firstDivStyle ={
margin:"0",
background: "rgba(22,24,56,1.0)"

};
const startStyle ={
  width: "1024px",
   height: "100%",
    position:"relative",
     margin:"auto"
};


function LandingPage(){
  return (
    <div style={firstDivStyle}>
        <input id="anPageName" name="page" type="hidden" value="landingpage"/>
        <div className="landingpage anima-word-break ">
            <div style={startStyle}>
                <div className="grouped">
                    Grouped
                </div>
                <div className="asafeandeasyplac">
                    A Safe and Easy Place to Find and Create Events Near You
                </div>
                <div className="register anima-smart-layers-pointers ">
                    <span className="span1">Register</span><span className="span2"><br /></span>
                </div>
                <div className="login anima-smart-layers-pointers ">
                    Login
                </div>

                <img alt="Image" anima-src={rectangle3} className="rectangle anima-animate-enter" src={rectangle3}/>

                <img alt="Image" anima-src={rectangle14} className="rectanglecopy anima-animate-enter1" src={rectangle14}/>

                <img alt="Image" anima-src={rectangle2} className="rectanglecopy2 anima-animate-enter2" src="data:image/gif;base64,R0lGODlhAQABAIAAAP///wAAACH5BAEAAAAALAAAAAABAAEAAAICRAEAOw=="/>

                <img alt="Image" anima-src="./img/landing-page-rectangle-copy-3@2x.png" className="rectanglecopy3" src="data:image/gif;base64,R0lGODlhAQABAIAAAP///wAAACH5BAEAAAAALAAAAAABAAEAAAICRAEAOw=="/>

                <img alt="Image" anima-src="./img/landing-page-rectangle-copy-3@2x.png" className="rectanglecopy4" src="data:image/gif;base64,R0lGODlhAQABAIAAAP///wAAACH5BAEAAAAALAAAAAABAAEAAAICRAEAOw=="/>

                <img alt="Image" anima-src="./img/landing-page-rectangle-1@2x.png" className="rectangle1 anima-animate-enter3" src="data:image/gif;base64,R0lGODlhAQABAIAAAP///wAAACH5BAEAAAAALAAAAAABAAEAAAICRAEAOw=="/>

                <img alt="Image" anima-src="./img/landing-page-rectangle-copy-8@2x.png" className="rectanglecopy8 anima-animate-enter4" src="data:image/gif;base64,R0lGODlhAQABAIAAAP///wAAACH5BAEAAAAALAAAAAABAAEAAAICRAEAOw=="/>

                <img alt="Image" anima-src="./img/landing-page-rectangle-copy-9@2x.png" className="rectanglecopy9 anima-animate-enter5" src="data:image/gif;base64,R0lGODlhAQABAIAAAP///wAAACH5BAEAAAAALAAAAAABAAEAAAICRAEAOw=="/>

                <img alt="Image" anima-src="./img/landing-page-rectangle-copy-3@2x.png" className="rectanglecopy5 anima-animate-enter6" src="data:image/gif;base64,R0lGODlhAQABAIAAAP///wAAACH5BAEAAAAALAAAAAABAAEAAAICRAEAOw=="/>

                <img alt="Image" anima-src="./img/landing-page-rectangle-copy-3@2x.png" className="rectanglecopy6 anima-animate-enter7" src="data:image/gif;base64,R0lGODlhAQABAIAAAP///wAAACH5BAEAAAAALAAAAAABAAEAAAICRAEAOw=="/>

                <img alt="Image" anima-src="./img/landing-page-rectangle-copy-13@2x.png" className="rectanglecopy13 anima-animate-enter8" src="data:image/gif;base64,R0lGODlhAQABAIAAAP///wAAACH5BAEAAAAALAAAAAABAAEAAAICRAEAOw=="/>

                <img alt="Image" anima-src="./img/landing-page-rectangle-copy-7@2x.png" className="rectanglecopy7 anima-animate-enter9" src="data:image/gif;base64,R0lGODlhAQABAIAAAP///wAAACH5BAEAAAAALAAAAAABAAEAAAICRAEAOw=="/>

            </div>
        </div>
    </div>
  );
};
export default LandingPage;
